import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const HomeReplacement = () => {
  return (
    <View>
      <Text>HomeReplacement</Text>
    </View>
  )
}

export default HomeReplacement

const styles = StyleSheet.create({})
